    /**
     * This method return the critical value of the table according to the
     * <code>df1</code> and <code>df2</code> degrees of freedom for the
     * significant level <code>sigValues</code>.
     *
     * @param df1 the first degree of freedom
     * @param df2 the second degree of freedom
     * @param sigValue the significant level values
     *
     * @return the critical value of the table
     */
    public static double FDistributionValue(int df1, int df2, double sigValue) {
        if (df1 > 20 || df2 > 100) {
            return -1;
        } else if (sigValue == 0.05) {
            return SIG_LEVEL_05[df2 - 1][df1 - 1];
        } else if (sigValue == 0.01) {
            return SIG_LEVEL_01[df2 - 1][df1 - 1];
        } else if (sigValue == 0.1) {
            return SIG_LEVEL_1[df2 - 1][df1 - 1];
        } else {
            return -1;
        }
    }
